export function fetchStockSearchData() {
  return dispatch => {
    dispatch(fetchStockSearchDataBegin());
    return fetch("./companylist.csv")
    .then(handleErrors)
    .then(res => {
      console.log(res);
    });
  }
}

export function handleErrors() {

